INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1Message', 'fr', 317, 'Le registre Croix-Rouge des engagements est un système en ligne qui permet aux individus et aux sociétés de engagent hébergement , biens et services pour une utilisation en temps de crise . Jusqu''à présent , La Croix-Rouge a été incapable d''accepter des dons de marchandises que nous manquons les installations pour les stocker . En utilisant le registre des gages , vous vous engagez à fournir les biens ou services comme et quand ils sont nécessaires.', 1, 1, current_date, current_date);
INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1Label', 'fr', 317, 'Quel est le registre des gages?', 1, 1, current_date, current_date);
INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1HelpBlock', 'fr', 317, '', 1, 1, current_date, current_date);
INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1PlaceHolder', 'fr', 317, '', 1, 1, current_date, current_date);
INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1Message', 'de', 318, 'Das Rote Kreuz Pfandregister ist ein Online- System, das Privatpersonen und Unternehmen , um Unterkunft, Waren und Dienstleistungen für den Einsatz in Krisenzeiten verpfänden können . Bis jetzt hat das Rote Kreuz nicht in der Lage , um Spenden von Waren anzunehmen , da wir nicht über die Einrichtungen , um sie zu speichern. Durch die Verwendung der Pfandregister , werden Sie unternehmen , um die Waren oder Dienstleistungen bereitstellt, und wenn sie gebraucht werden.', 1, 1, current_date, current_date);
INSERT INTO MESSAGERESOURCE(VIEWID, MESSAGEKEY, LOCALE, LOCALEREFERENCEID, MESSAGE, CREATEDBYID, UPDATEDBYID, DATECREATED, DATEUPDATED) VALUES (8, 'frmLandingLandingMainMessages1Label', 'de', 318, 'Was ist der Pfandregister?', 1, 1, current_date, current_date);
